function MyApp({ Component, pageProps }) {
  return (
    <>
      <div className="wrapper">
        <Component {...pageProps} />
      </div>
      <style global jsx>{`
        .wrapper {
          height: 100vh;
          background: #1d1f21;
        }
      `}</style>
    </>
  );
}

